import {Box, Button, makeStyles, TextField} from "@material-ui/core"
import {OnlyOwner} from "../hooks/hookAdmin"


export const Admin = () => {

    const hook = OnlyOwner()

    return (
        <>
            <Button variant="outlined" size="large" onClick={() => hook._getState()}>GET STATE</Button>
            <Button variant="outlined" size="large" onClick={() => hook._getBalance()}>GET BALANCE</Button>
            <Button variant="outlined" size="large" onClick={() => hook._startLottery()}>GET BALANCE</Button>
            <Button variant="outlined" size="large" onClick={() => hook._endLottery()}>GET BALANCE</Button>
        </>
    )
}
